import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

// Import all necessary components
import PreLandingPage from './components/PreLandingPage';
import LandingPage from './components/LandingPage';
import TourBooking from './components/TourBooking'; 
//import RideBooking from './components/RideBooking';
import Signup from './components/Signup'; // Import Signup component
import Login from './components/Login'; // Import Login component
import loading from './loading.gif';

function App() {
  return (
    <Router>
      <Routes>
        {/* Routes for Signup and Login */}
        <Route path="/" element={<PreLandingPage />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/login" element={<Login />} />
        <Route path="/landing" element={<LandingPage />} />
        <Route path="/tour-booking" element={<TourBooking />} />
        {/* Main Routes */}
        {/* <Route path="/" element={<LandingPage />} />

        <Route path="/ticket-reservation" element={<TicketReservation />} />
        <Route path="/ride-booking" element={<RideBooking />} /> */}
      </Routes>
    </Router>
  );
}

export default App;
